import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import data from "./data";

const Customers = () => {
  return (
    <React.Fragment>
      {/* <section className="container">
        <div className='title'>
          <h2> our reviews</h2>
          <div className='underline'></div>
        </div>
        <Feedback />
      </section> */}
      <p class="main-heading">Customer Feedback</p>
      <p class="paragraph">
        Within a short span of time, Indelect as an organization has had the
        great privilege of working with a number of prominent organizations and
        individuals. With an enormous base of clientele, growing at a sound
        pace, Indelect aspires to build long lasting ties by providing world
        class services and solutions
      </p>
      {data.map((item, index) => {
        return (
          <React.Fragment key={item.name}>
            <div class="card bg-light mb-4 card-style">
              <div class="card-header">${item.name}, ${item.position}</div>
              <div class="card-body">
                <h5 class="card-title">Biopsy & Craniotomy</h5>
              </div>
            </div>
          </React.Fragment>
        );
      })}
      ;
    </React.Fragment>
  );
};

export default Customers;
